import jquery from 'jquery';
import './i18n'
window.$ = window.jQuery = jquery;
ReactDOM.render(
    <React.StrictMode>
        <Suspense fallback={<div>Loading...</div>}>
            <App />
        </Suspense>
    </React.StrictMode>,
    document.getElementById('root')
);
